import './WGIF.css' 
import promo1 from './promo3.mp4'

const WGIF = () => {
    return (
    <div className="MainVideo">
        <video-js
    autoplay
    src
    id="my-player"
    className="video-js"
    controls
    loop={true}
    preload="auto"
    data-setup='{}'>
 
</video-js>

    </div>
    );
}
 
export default WGIF;
